import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Navbar from '../components/Navbar';
import './LandingPage.css';
import Logo from '../assets/logo.jpg';

const LandingPage = () => {
  const [isPopupVisible, setIsPopupVisible] = useState(false);

  const showPopup = () => {
    setIsPopupVisible(true);
  };

  const hidePopup = () => {
    setIsPopupVisible(false);
  };

  return (
    <div className="landing-page">
      <Navbar />
      <header className="landing-header">
        <img src={Logo} alt="QueueBy6 Logo" className="app-logo" />
        <h1>Welcome!</h1>
        <p>Your efficient solution for scheduling patient appointments.</p>
      </header>
      <div className="hero-section">
        <button onClick={showPopup} className="hero-button">Get Started</button>
      </div>
      {isPopupVisible && (
        <div className="popup" onClick={hidePopup}>
          <div className="popup-content" onClick={(e) => e.stopPropagation()}>
            <span className="close" onClick={hidePopup}>&times;</span>
            <h2>Login</h2>
            <form id="loginForm">
              <label htmlFor="username">Username:</label>
              <input type="text" id="username" name="username" required />
              <label htmlFor="password">Password:</label>
              <input type="password" id="password" name="password" required />
              <button type="submit">Login</button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default LandingPage;
